# G2RS Global Onboarding (GO) API Implementation Plan

**Last Updated:** 2025-10-31
**API Documentation:** G2RS GO API Implementation Guide - 10102024.pdf
**Status:** Planning Phase

## Overview

The G2RS Global Onboarding (GO) API provides merchant risk evaluation during onboarding. It assesses merchants across multiple risk categories and generates a predictive risk score indicating the likelihood of a risk event within 12 months.

### API Purpose
- Evaluate merchant risk at underwriting
- Re-underwrite existing merchants
- Assess card network compliance and fraud risk
- Eliminate portal-based file upload processes

### Base URLs
- **Sandbox:** https://api-sandbox.g2netview.com/go/v1/sandbox/risk-evaluation/
- **Production:** https://api.g2netview.com/go/v1/risk-evaluation/

## Risk Assessment Components

GO evaluates merchants across five categories:
1. **Merchant Risk History** - Prior violations and terminations
2. **Content Compliance** - Card network rule compliance
3. **Watchlist, Sanctions & Legal** - OFAC, legal cases, PEP checks
4. **Consumer Ratings & Adverse Media** - BBB, Trustpilot, CFPB, Google reviews
5. **Operational Risk** - Email validation, address verification

## Authentication Strategy

### OAuth 2.0 Client Credentials Flow

```typescript
// api-server/src/services/g2/auth.ts
interface G2AuthConfig {
  clientId: string;
  clientSecret: string;
  tokenUrl: string;
  cacheDuration: number; // 55 minutes (token valid for 1 hour)
}

class G2AuthService {
  private tokenCache: {
    token: string | null;
    expiresAt: number | null;
  };

  async getAccessToken(): Promise<string> {
    // Check cache first
    if (this.tokenCache.token && Date.now() < this.tokenCache.expiresAt) {
      return this.tokenCache.token;
    }

    // Request new token from Okta
    const credentials = Buffer.from(
      `${clientId}:${clientSecret}`
    ).toString('base64');

    const response = await fetch(tokenUrl, {
      method: 'POST',
      headers: {
        'Content-Type': 'application/x-www-form-urlencoded',
        'Authorization': `Basic ${credentials}`
      },
      body: 'grant_type=client_credentials'
    });

    const data = await response.json();

    // Cache token (expires in 55 minutes)
    this.tokenCache = {
      token: data.access_token,
      expiresAt: Date.now() + (55 * 60 * 1000)
    };

    return data.access_token;
  }
}
```

### Environment Variables
```bash
# Sandbox
G2_GO_SANDBOX_CLIENT_ID=
G2_GO_SANDBOX_CLIENT_SECRET=
G2_GO_SANDBOX_TOKEN_URL=https://sso.g2risksolutions.com/oauth2/aus1owavhv6lOeErx1d8/v1/token

# Production
G2_GO_CLIENT_ID=
G2_GO_CLIENT_SECRET=
G2_GO_TOKEN_URL=https://sso.g2risksolutions.com/oauth2/aus1owaqit51cBAHO1d8/v1/token
```

## Core API Endpoints

### 1. Initiate Merchant Risk Evaluation

**Endpoint:** `POST /v1/risk-evaluation/boarding-case`

**Purpose:** Submit merchant for comprehensive risk assessment

**Request Schema:**
```typescript
interface GOBoardingRequest {
  // Merchant Identification (merchantName is required)
  merchantName: string;
  urlString?: string;
  mid?: string;
  merchantDBA?: string;
  billingDescriptor?: string;
  mcc?: string;

  // Card Network Information
  mastercardICA?: string;
  visaBIN?: string;

  // Merchant Address
  merchantAddress?: {
    address1?: string;
    address2?: string;
    city?: string;
    regionState?: string;
    country?: string;
    postcode?: string;
    countryCode?: string;
  };

  // Contact Information
  phoneNumber?: string;
  emailAddress?: string;
  primaryMerchantContactName?: string;

  // Principal Information
  principalName?: string;
  principalAddress?: {
    address1?: string;
    address2?: string;
    city?: string;
    regionState?: string;
    country?: string;
    postcode?: string;
    countryCode?: string;
  };
  principalPhone?: string;
  principalEmail?: string;

  // Custom Data Fields
  dataField1?: string;
  dataField2?: string;
  dataField3?: string;

  // Report Components (1-5 required)
  components: Array<
    | 'MERCHANT_RISK_HISTORY'
    | 'CONTENT_COMPLIANCE'
    | 'CONSUMER_RATINGS_AND_ADVERSE_MEDIA'
    | 'WATCHLIST_SANCTIONS_AND_LEGAL'
    | 'OPERATIONAL_RISK'
  >;
}
```

**Response:**
```typescript
interface GOBoardingResponse {
  requestId: string;
  boardingCaseId: number;
  merchantGroupMembershipId: number;
  urlId: number;
  merchantId: number;
  merchantGroupId: number;
  businessId: number;
  compassScore: number | null; // null while IN_PROGRESS
  caseCreationDate: string;
  status: 'IN_PROGRESS' | 'COMPLETED' | 'FAILED';
  components: Array<{
    name: string;
    status: 'IN_PROGRESS' | 'COMPLETED' | 'FAILED';
    failureResponse: string | null;
    results: any | null;
  }>;
}
```

### 2. Retrieve Report Results

**Endpoint:** `GET /v1/risk-evaluation/boarding-case/{boardingCaseId}`

**Purpose:** Fetch completed risk assessment results

**Polling Strategy:**
- Poll every 30 seconds while status is 'IN_PROGRESS'
- Maximum 10 polling attempts (5 minutes total)
- Reports typically complete within 2-3 minutes

**Response Includes:**
- Overall COMPASS risk score (0-1000, higher = riskier)
- Component-level risk scores
- Detailed findings per component
- Evidence and data sources

### 3. Get Action-Reason Catalog

**Endpoint:** `GET /v1/risk-evaluation/action-reasons`

**Query Parameters:**
- `context=GLOBAL_ONBOARDING_NEW_MERCHANT` or `GLOBAL_ONBOARDING_EXISTING_MERCHANT`

**Purpose:** Retrieve valid actions and reasons for merchant decisioning

**Response:**
```typescript
interface ActionReason {
  actionId: number;
  name: 'Cleared' | 'Pending' | 'Terminated' | 'Approved';
  reasons: Record<string, string>; // reasonId: reasonDescription
  context: string;
}
```

### 4. Take Action on Merchant

**Endpoint:** `PUT /v1/risk-evaluation/boarding-case/action-cases/{caseId}`

**Purpose:** Approve, reject, or pend merchant based on risk assessment

**Request:**
```typescript
interface TakeActionRequest {
  reasonId: number;
  actionId: number;
  destinationMerchantGroupId?: number; // Required if action is APPROVED
}
```

## Database Schema

### GO Boarding Cases Table
```sql
-- api-server/src/db/schema.ts
export const goBoardingCases = pgTable('go_boarding_cases', {
  id: serial('id').primaryKey(),
  merchantId: text('merchant_id').notNull(),
  boardingCaseId: integer('boarding_case_id').notNull().unique(),
  urlId: integer('url_id'),
  businessId: integer('business_id'),
  merchantGroupId: integer('merchant_group_id'),
  compassScore: integer('compass_score'),
  status: text('status').notNull(), // IN_PROGRESS, COMPLETED, FAILED
  requestPayload: jsonb('request_payload'),
  responsePayload: jsonb('response_payload'),
  createdAt: timestamp('created_at').defaultNow(),
  updatedAt: timestamp('updated_at').defaultNow(),
  createdBy: text('created_by').notNull(),
});

export const goBoardingCaseComponents = pgTable('go_boarding_case_components', {
  id: serial('id').primaryKey(),
  boardingCaseId: integer('boarding_case_id').notNull().references(() => goBoardingCases.boardingCaseId),
  componentName: text('component_name').notNull(),
  riskScore: integer('risk_score'),
  status: text('status').notNull(),
  results: jsonb('results'),
  createdAt: timestamp('created_at').defaultNow(),
