export const goBoardingCaseActions = pgTable('go_boarding_case_actions', {
  id: serial('id').primaryKey(),
  boardingCaseId: integer('boarding_case_id').notNull().references(() => goBoardingCases.boardingCaseId),
  actionId: integer('action_id').notNull(),
