## API Service Implementation

```typescript
// api-server/src/services/g2/go-service.ts
export class G2GOService {
  private authService: G2AuthService;
  private baseUrl: string;

  constructor() {
    this.authService = new G2AuthService();
    this.baseUrl = process.env.G2_GO_BASE_URL;
  }

  async submitBoardingCase(
    request: GOBoardingRequest
  ): Promise<GOBoardingResponse> {
    const token = await this.authService.getAccessToken();

    const response = await fetch(`${this.baseUrl}/boarding-case`, {
      method: 'POST',
      headers: {
        'Authorization': `Bearer ${token}`,
        'Content-Type': 'application/json',
      },
      body: JSON.stringify(request),
    });

    if (!response.ok) {
      throw new G2APIError('Failed to submit boarding case', response);
    }

    const data = await response.json();

    // Store in database
    await db.insert(goBoardingCases).values({
      merchantId: request.mid || 'PENDING',
      boardingCaseId: data.boardingCaseId,
      urlId: data.urlId,
      businessId: data.businessId,
      merchantGroupId: data.merchantGroupId,
      status: data.status,
      requestPayload: request,
      responsePayload: data,
      createdBy: 'system',
    });

    return data;
  }

  async pollBoardingCaseStatus(
    boardingCaseId: number,
    maxAttempts: number = 10
  ): Promise<GOBoardingResponse> {
    let attempts = 0;

    while (attempts < maxAttempts) {
      const result = await this.getBoardingCase(boardingCaseId);

      if (result.status === 'COMPLETED' || result.status === 'FAILED') {
        // Update database
        await db.update(goBoardingCases)
          .set({
            status: result.status,
            compassScore: result.compassScore,
            responsePayload: result,
            updatedAt: new Date(),
          })
          .where(eq(goBoardingCases.boardingCaseId, boardingCaseId));

        return result;
      }

      attempts++;
      await new Promise(resolve => setTimeout(resolve, 30000)); // 30 seconds
    }

    throw new Error('Boarding case polling timeout');
  }

  async getBoardingCase(
    boardingCaseId: number
  ): Promise<GOBoardingResponse> {
    const token = await this.authService.getAccessToken();

    const response = await fetch(
      `${this.baseUrl}/boarding-case/${boardingCaseId}`,
      {
        headers: {
          'Authorization': `Bearer ${token}`,
        },
      }
    );

    if (!response.ok) {
      throw new G2APIError('Failed to retrieve boarding case', response);
    }

    return response.json();
  }

  async takeAction(
    caseId: number,
    actionId: number,
    reasonId: number,
    destinationMerchantGroupId?: number
  ): Promise<void> {
    const token = await this.authService.getAccessToken();

    const response = await fetch(
      `${this.baseUrl}/boarding-case/action-cases/${caseId}`,
      {
        method: 'PUT',
        headers: {
          'Authorization': `Bearer ${token}`,
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          actionId,
          reasonId,
          destinationMerchantGroupId,
        }),
      }
    );

    if (!response.ok) {
      throw new G2APIError('Failed to take action', response);
    }

    // Store action in database
    await db.insert(goBoardingCaseActions).values({
      boardingCaseId: caseId,
      actionId,
      reasonId,
      destinationMerchantGroupId,
      actionedBy: 'system', // Replace with actual user
    });
  }
}
```

## Frontend Integration

### Merchant Onboarding Form
```typescript
// src/app/actions/go.ts
'use server';

export async function submitMerchantForGO(
  merchantData: GOBoardingRequest
) {
  const goService = new G2GOService();

  try {
    // Submit boarding case
    const result = await goService.submitBoardingCase(merchantData);

    // Start background polling
    pollBoardingCaseInBackground(result.boardingCaseId);

    return {
      success: true,
      boardingCaseId: result.boardingCaseId,
    };
  } catch (error) {
    console.error('GO submission error:', error);
    return {
      success: false,
      error: error.message,
    };
  }
}

async function pollBoardingCaseInBackground(boardingCaseId: number) {
  // This should be handled by a background job/queue in production
  const goService = new G2GOService();

  try {
    const result = await goService.pollBoardingCaseStatus(boardingCaseId);

    // Trigger notification when complete
    if (result.status === 'COMPLETED') {
      await notifyMerchantRiskAssessmentComplete(boardingCaseId);
    }
  } catch (error) {
    console.error('Polling error:', error);
  }
}
```

## Integration Points

### 1. Merchant Onboarding Workflow
- Trigger GO assessment when new merchant applies
- Display risk score in underwriter dashboard
- Block high-risk merchants automatically
- Route medium-risk to manual review

### 2. Re-underwriting Process
- Schedule periodic GO assessments for existing merchants
- Alert on risk score increases
- Automate compliance reviews

### 3. Compliance Reporting
- Generate risk assessment reports for audits
- Track merchant risk trends over time
- Export GO data for FDIC compliance

## Error Handling

```typescript
class G2APIError extends Error {
  constructor(
    message: string,
    public response: Response,
    public statusCode?: number
  ) {
    super(message);
    this.name = 'G2APIError';
  }
}

// Retry logic for transient failures
async function withRetry<T>(
  fn: () => Promise<T>,
  maxRetries: number = 3
): Promise<T> {
  let lastError: Error;

  for (let i = 0; i < maxRetries; i++) {
    try {
      return await fn();
    } catch (error) {
      lastError = error;

      // Don't retry on 4xx errors (except 429 rate limit)
      if (error.statusCode >= 400 && error.statusCode < 500 && error.statusCode !== 429) {
        throw error;
      }

      // Exponential backoff
      await new Promise(resolve =>
        setTimeout(resolve, Math.pow(2, i) * 1000)
      );
    }
  }

  throw lastError;
}
```

## Security Considerations

1. **Credential Management**
   - Store client credentials in secure environment variables
   - Never log or expose credentials
   - Rotate credentials periodically

2. **Data Privacy**
   - Encrypt GO report data at rest
   - Implement field-level encryption for PII
   - Audit all access to merchant risk data

3. **Rate Limiting**
   - Respect G2RS API rate limits
   - Implement request queuing
   - Monitor API usage metrics

4. **Audit Trail**
   - Log all GO API requests and responses
   - Track who initiated risk assessments
   - Record all actions taken on merchants

## Testing Strategy

### Sandbox Testing
1. Test all components with sandbox API
2. Validate authentication flow
3. Test error scenarios (bad data, timeouts)
4. Verify polling mechanism
5. Test action workflows

### Integration Testing
```typescript
// api-server/src/test/go-api.test.ts
describe('G2 GO API Integration', () => {
  it('should submit merchant for risk evaluation', async () => {
    const goService = new G2GOService();

    const result = await goService.submitBoardingCase({
      merchantName: 'Test Merchant',
      urlString: 'www.test-merchant.com',
      components: ['MERCHANT_RISK_HISTORY'],
    });

    expect(result.boardingCaseId).toBeDefined();
    expect(result.status).toBe('IN_PROGRESS');
  });

  it('should poll and retrieve completed report', async () => {
    const goService = new G2GOService();
    const boardingCaseId = 100001; // Known sandbox case

    const result = await goService.pollBoardingCaseStatus(boardingCaseId);

    expect(result.status).toBe('COMPLETED');
    expect(result.compassScore).toBeGreaterThan(0);
  });
});
```

## Performance Optimization

1. **Token Caching:** Cache OAuth tokens for 55 minutes
2. **Response Caching:** Cache action-reason catalog (updates infrequently)
3. **Batch Processing:** Queue multiple boarding requests
4. **Async Polling:** Use background jobs for polling instead of blocking requests
5. **Database Indexing:** Index boardingCaseId, merchantId, status fields

## Monitoring & Alerts

Track the following metrics:
- GO API request volume
- Average report completion time
- Error rates by endpoint
- Token refresh frequency
- Risk score distributions
- Action patterns (approve/reject ratios)

## Documentation

Create internal documentation for:
- GO API integration guide for developers
- Risk score interpretation guide for underwriters
- Action workflow procedures
- Troubleshooting common issues
- Sandbox testing guide

## Next Steps

1. **Obtain API Credentials:** Contact G2RS (clientservices@g2risksolutions.com) for sandbox and production credentials
2. **Review Pricing:** Confirm API call costs and volume limits
3. **Define Use Cases:** Determine which merchant onboarding scenarios require GO assessment
4. **Stakeholder Alignment:** Get approval from compliance and underwriting teams
5. **Begin Phase 1:** Start with authentication and basic API client implementation

