### Swagger Documentation
- **Sandbox:** https://api-sandbox.g2netview.com/mdmx/swagger-ui/index.html

## G2RS Merchant Data Model

### Merchant Definition
A unique merchant in G2RS is defined by the combination of:
- **merchantId:** G2RS-generated unique identifier (NOT the same as MID)
- **urlId:** Unique identifier for the merchant's URL

Key Concepts:
- One `merchantId` can have multiple `urlId` values (separate monitoring records)
- One `mid` (Merchant ID) can exist in multiple merchant groups
- One merchant group can only have ONE actively monitored URL
- System-generated MIDs are assigned when customers don't provide one

```typescript
interface G2Merchant {
  merchantId: number;        // G2RS internal ID
  urlId: number;            // G2RS URL identifier
  businessId: number;       // Business entity ID
  mid: string;              // Customer-provided Merchant ID
  systemGeneratedMid: boolean;
  merchantGroupId: number;  // Project/portfolio ID
  urlString: string;
  inMonitoring: boolean;
}
```

## Authentication Strategy

### OAuth 2.0 Client Credentials Flow

```typescript
// api-server/src/services/g2/mdmx-auth.ts
class G2MDMXAuthService {
  private tokenCache: {
    token: string | null;
    expiresAt: number | null;
  };

  async getAccessToken(): Promise<string> {
    // Check cache (token valid for 1 hour, cache for 55 minutes)
    if (this.tokenCache.token && Date.now() < this.tokenCache.expiresAt) {
      return this.tokenCache.token;
    }

    const credentials = Buffer.from(
      `${process.env.G2_MDMX_CLIENT_ID}:${process.env.G2_MDMX_CLIENT_SECRET}`
    ).toString('base64');

    const response = await fetch(process.env.G2_MDMX_TOKEN_URL, {
      method: 'POST',
      headers: {
        'Content-Type': 'application/x-www-form-urlencoded',
        'Authorization': `Basic ${credentials}`
      },
      body: 'grant_type=client_credentials'
    });

    const data = await response.json();

    this.tokenCache = {
      token: data.access_token,
      expiresAt: Date.now() + (55 * 60 * 1000)
    };

    return data.access_token;
  }
}
```

