## MDMX Service Implementation

```typescript
// api-server/src/services/g2/mdmx-service.ts
export class G2MDMXService {
  private authService: G2MDMXAuthService;
  private baseUrl: string;

  constructor() {
    this.authService = new G2MDMXAuthService();
    this.baseUrl = process.env.G2_MDMX_BASE_URL;
  }

  /**
   * Create new merchant in G2RS monitoring
   */
  async createMerchant(
    request: CreateMerchantRequest
  ): Promise<CreateMerchantResponse> {
    const token = await this.authService.getAccessToken();

    const response = await fetch(`${this.baseUrl}/merchants`, {
      method: 'POST',
      headers: {
        'Authorization': `Bearer ${token}`,
        'Content-Type': 'application/json',
      },
      body: JSON.stringify(request),
    });

    if (!response.ok) {
      throw new G2APIError('Failed to create merchant', response);
    }

    const data = await response.json();

    // Store sync record
    await db.insert(g2MerchantSync).values({
      ourMerchantId: request.mid || data.mid,
      g2MerchantId: data.merchantId,
      g2UrlId: data.urlId,
      g2BusinessId: data.businessId,
      g2MerchantGroupId: data.merchantGroupId,
      mid: data.mid,
      urlString: data.urlString,
      inMonitoring: data.inMonitoring,
      systemGeneratedMid: data.systemGeneratedMid,
    });

    // Log update
    await this.logUpdate('CREATE', request, data, true);

    return data;
  }

  /**
   * Update existing merchant
   */
  async updateMerchant(
    request: UpdateMerchantRequest
  ): Promise<UpdateMerchantResponse> {
    const token = await this.authService.getAccessToken();

    const response = await fetch(`${this.baseUrl}/merchants`, {
      method: 'PUT',
      headers: {
        'Authorization': `Bearer ${token}`,
        'Content-Type': 'application/json',
      },
      body: JSON.stringify(request),
    });

    if (!response.ok) {
      throw new G2APIError('Failed to update merchant', response);
    }

    const data = await response.json();

    // Update sync record
    await db.update(g2MerchantSync)
      .set({
        lastSyncedAt: new Date(),
        updatedAt: new Date(),
      })
      .where(eq(g2MerchantSync.g2MerchantId, request.merchantId));

    // Log update
    await this.logUpdate('UPDATE', request, data, true);

    return data;
  }

  /**
   * Remove merchant from monitoring
   */
  async removeFromMonitoring(
    merchantId: number,
    urlId: number
  ): Promise<void> {
    await this.updateMerchant({
      merchantId,
      urlId,
      inMonitoring: false,
    });

    // Update local status
    await db.update(g2MerchantSync)
      .set({
        inMonitoring: false,
        updatedAt: new Date(),
      })
      .where(eq(g2MerchantSync.g2MerchantId, merchantId));
  }

  /**
   * Search for merchants
   */
  async searchMerchants(
    params: MerchantSearchParams
  ): Promise<MerchantSearchResult[]> {
    const token = await this.authService.getAccessToken();

    const queryString = new URLSearchParams(
      Object.entries(params).filter(([, v]) => v != null)
    ).toString();

    const response = await fetch(
      `${this.baseUrl}/merchant-search?${queryString}`,
      {
        headers: {
          'Authorization': `Bearer ${token}`,
        },
      }
    );

    if (!response.ok) {
      throw new G2APIError('Failed to search merchants', response);
    }

    return response.json();
  }

  /**
   * Get merchant profile details
   */
  async getMerchantProfile(
    merchantId: number,
    businessId: number,
    urlId: number
  ): Promise<MerchantProfile> {
    const token = await this.authService.getAccessToken();

    const params = new URLSearchParams({
      merchantId: merchantId.toString(),
      businessId: businessId.toString(),
      urlId: urlId.toString(),
    });

    const response = await fetch(
      `${this.baseUrl}/merchant-profile?${params}`,
      {
        headers: {
          'Authorization': `Bearer ${token}`,
        },
      }
    );

    if (!response.ok) {
      throw new G2APIError('Failed to get merchant profile', response);
    }

    return response.json();
  }

  /**
   * Get all merchant groups
   */
  async getMerchantGroups(): Promise<MerchantGroup[]> {
    const token = await this.authService.getAccessToken();

    const response = await fetch(`${this.baseUrl}/merchant-groups`, {
      headers: {
        'Authorization': `Bearer ${token}`,
      },
    });

    if (!response.ok) {
      throw new G2APIError('Failed to get merchant groups', response);
    }

    const groups = await response.json();

    // Cache groups
    for (const group of groups) {
      await db.insert(g2MerchantGroups)
        .values({
          merchantGroupId: group.merchantGroupId,
          name: group.name,
          description: group.description,
        })
        .onConflictDoUpdate({
          target: g2MerchantGroups.merchantGroupId,
          set: {
            name: group.name,
            description: group.description,
            lastFetchedAt: new Date(),
          },
        });
    }

    return groups;
  }

  /**
   * Bulk sync merchants to G2
   */
  async bulkSyncMerchants(
    merchants: CreateMerchantRequest[]
  ): Promise<BulkSyncResult> {
    const results = {
      success: [],
      failed: [],
    };

    // Rate limiting: 5000 req/min = ~83 req/sec
    // Process in batches of 50 with delays
    const batchSize = 50;

    for (let i = 0; i < merchants.length; i += batchSize) {
      const batch = merchants.slice(i, i + batchSize);

      await Promise.allSettled(
        batch.map(async (merchant) => {
          try {
            const result = await this.createMerchant(merchant);
            results.success.push({
              merchant: merchant.merchantName,
              g2MerchantId: result.merchantId,
            });
          } catch (error) {
            results.failed.push({
              merchant: merchant.merchantName,
              error: error.message,
            });
          }
        })
      );

      // Delay between batches to respect rate limit
      if (i + batchSize < merchants.length) {
        await new Promise(resolve => setTimeout(resolve, 1000));
      }
    }

    return results;
  }

  private async logUpdate(
    updateType: 'CREATE' | 'UPDATE' | 'REMOVE',
    request: any,
    response: any,
    success: boolean,
    errorMessage?: string
  ): Promise<void> {
    await db.insert(g2MerchantUpdates).values({
      g2MerchantId: response?.merchantId || request.merchantId,
      updateType,
      requestPayload: request,
      responsePayload: response,
      success,
      errorMessage,
      updatedBy: 'system', // Replace with actual user
    });
  }
}
```

## Integration with Existing System

### Sync Strategy

**Option 1: Real-time Sync (Recommended for new system)**
- Sync merchant to G2 immediately when created/updated in our system
- Store G2 IDs alongside our merchant records
- Keep systems in sync in real-time

**Option 2: Batch Sync (For existing portfolios)**
- Daily/weekly sync of all merchants
- Compare our data vs G2 data
- Update discrepancies

```typescript
// api-server/src/services/g2/sync-scheduler.ts
export class G2SyncScheduler {
  /**
   * Full reconciliation sync
   * Run daily to ensure data consistency
   */
  async fullReconciliationSync(): Promise<void> {
    const mdmxService = new G2MDMXService();

    // 1. Fetch all our merchants
    const ourMerchants = await db.select().from(merchants);

    // 2. Fetch all G2 synced merchants
    const g2SyncedMerchants = await db.select().from(g2MerchantSync);

    // 3. Find merchants not yet synced to G2
    const unsyncedMerchants = ourMerchants.filter(
      m => !g2SyncedMerchants.find(g => g.ourMerchantId === m.id)
    );

    // 4. Sync unsynced merchants
    if (unsyncedMerchants.length > 0) {
      await mdmxService.bulkSyncMerchants(
        unsyncedMerchants.map(this.mapToG2Format)
      );
    }

    // 5. Verify synced merchants still exist in G2
    for (const syncedMerchant of g2SyncedMerchants) {
      try {
        await mdmxService.getMerchantProfile(
          syncedMerchant.g2MerchantId,
          syncedMerchant.g2BusinessId,
          syncedMerchant.g2UrlId
        );
      } catch (error) {
        if (error.statusCode === 404) {
          // Merchant not found in G2, mark for re-sync
          console.warn(`Merchant ${syncedMerchant.g2MerchantId} not found in G2`);
        }
      }
    }
  }

  /**
   * Sync merchant updates
   * Run hourly to push recent changes
   */
  async incrementalSync(): Promise<void> {
    const mdmxService = new G2MDMXService();

    // Find merchants updated in last hour that are synced to G2
    const recentlyUpdated = await db
      .select()
      .from(merchants)
      .where(
        and(
          gte(merchants.updatedAt, new Date(Date.now() - 3600000)),
          exists(
            db.select()
              .from(g2MerchantSync)
              .where(eq(g2MerchantSync.ourMerchantId, merchants.id))
          )
        )
      );

    // Push updates to G2
    for (const merchant of recentlyUpdated) {
      const syncRecord = await db
        .select()
        .from(g2MerchantSync)
        .where(eq(g2MerchantSync.ourMerchantId, merchant.id))
        .limit(1);

      if (syncRecord.length > 0) {
        await mdmxService.updateMerchant({
          merchantId: syncRecord[0].g2MerchantId,
          urlId: syncRecord[0].g2UrlId,
          ...this.mapToG2Format(merchant),
        });
      }
    }
  }

  private mapToG2Format(merchant: Merchant): CreateMerchantRequest {
    return {
      merchantName: merchant.name,
      urlString: merchant.website,
      mid: merchant.merchantId,
      merchantGroupId: parseInt(process.env.G2_DEFAULT_MERCHANT_GROUP_ID),
      // Map other fields...
    };
  }
}
```

