   */
  async syncPMMCases(daysBack: number = 7): Promise<number> {
    const publishedAfter = new Date();
    publishedAfter.setDate(publishedAfter.getDate() - daysBack);

    const cases = await this.getURLCases({
      publishedAfter: publishedAfter.toISOString(),
      status: 'PUBLISHED',
    });

    let syncedCount = 0;

    for (const urlCase of cases) {
      // Check if case already exists
      const existing = await db.select()
        .from(pmmCases)
        .where(eq(pmmCases.caseId, urlCase.caseId))
        .limit(1);

      if (existing.length === 0) {
        // Fetch screenshots
        const screenshots = await this.getCaseScreenshots(urlCase.caseId);

        // Insert new case
        await db.insert(pmmCases).values({
          caseId: urlCase.caseId,
          merchantId: urlCase.merchantId,
          urlId: urlCase.urlId,
          businessId: urlCase.businessId,
          merchantName: urlCase.merchantName,
          urlString: urlCase.urlString,
          caseStatus: urlCase.caseStatus,
          caseSeverity: urlCase.caseSeverity,
          caseCategory: urlCase.caseCategory,
          caseSubCategory: urlCase.caseSubCategory,
          publishedDate: new Date(urlCase.publishedDate),
          dueDate: new Date(urlCase.dueDate),
          caseData: urlCase,
        });

        // Store screenshots
        for (const screenshot of screenshots) {
          await db.insert(caseScreenshots).values({
            caseId: urlCase.caseId,
            screenshotUrl: screenshot.screenshotUrl,
            screenshotBase64: screenshot.screenshotBase64,
            caption: screenshot.caption,
            capturedDate: new Date(screenshot.capturedDate),
          });
        }

        syncedCount++;
      }
    }

    return syncedCount;
  }

  /**
   * Sync new TLD leads from G2
