### Webhook Handler Implementation

```typescript
// api-server/src/routes/g2/webhooks.ts
export const g2WebhookRoutes: FastifyPluginAsync = async (fastify) => {
  fastify.post('/webhooks/monitoring', async (request, reply) => {
    // Verify webhook token
    const token = request.headers.authorization?.replace('Bearer ', '');

    if (token !== process.env.G2_WEBHOOK_TOKEN) {
      return reply.code(401).send({ error: 'Unauthorized' });
    }

    const notification = request.body as WebhookNotification;

    // Process notification based on type
    switch (notification.type) {
      case 'REPORT_CASE_PUBLISHED':
        await handleNewPMMReport(notification.entityId);
        break;

      case 'LEAD_CASE_STATUS_UPDATED':
        await handleTLDLeadUpdate(notification.entityId);
        break;

      case 'INVESTIGATION_CASE_STATUS_UPDATED':
        await handleInvestigationUpdate(notification.entityId);
        break;
    }

    return reply.code(200).send({ received: true });
  });
};

async function handleNewPMMReport(reportId: number) {
  const monitoringService = new G2MonitoringService();

  // Fetch all cases from the new report
  const cases = await monitoringService.getURLCases({
    // Filter for this report
  });

  // Store cases in database
  for (const urlCase of cases) {
    await db.insert(pmmCases).values({
      caseId: urlCase.caseId,
      merchantId: urlCase.merchantId,
      caseStatus: urlCase.caseStatus,
      caseCategory: urlCase.caseCategory,
      publishedDate: new Date(urlCase.publishedDate),
      dueDate: new Date(urlCase.dueDate),
      caseData: urlCase,
    });
  }

  // Notify risk team
  await notifyTeam('New PMM Report Available', cases.length);
}

async function handleTLDLeadUpdate(leadId: number) {
  const monitoringService = new G2MonitoringService();

  // Fetch updated lead details
  const lead = await monitoringService.getLeadCase(leadId);

  // Update database
  await db.update(tldLeads)
    .set({
      leadStatus: lead.leadStatus,
      updatedAt: new Date(),
    })
    .where(eq(tldLeads.leadId, leadId));

  // Alert team if status changed to high priority
  if (lead.riskScore > 80) {
    await alertTeam('High-Risk TLD Lead', lead);
  }
}
