## Monitoring Service Implementation

```typescript
// api-server/src/services/g2/monitoring-service.ts
export class G2MonitoringService {
  private authService: G2MonitoringAuthService;
  private baseUrl: string;

  constructor() {
    this.authService = new G2MonitoringAuthService();
    this.baseUrl = process.env.G2_MONITORING_BASE_URL;
  }

  /**
   * Fetch PMM cases (URL cases)
   */
  async getURLCases(filters?: URLCaseFilters): Promise<URLCase[]> {
    const token = await this.authService.getAccessToken();

    const params = new URLSearchParams(
      Object.entries(filters || {}).filter(([, v]) => v != null)
    );

    const response = await fetch(`${this.baseUrl}/url-cases?${params}`, {
      headers: {
        'Authorization': `Bearer ${token}`,
      },
    });

    if (!response.ok) {
      throw new G2APIError('Failed to fetch URL cases', response);
    }

    return response.json();
  }

  /**
   * Fetch specific PMM case details
   */
  async getURLCase(caseId: number): Promise<URLCase> {
    const token = await this.authService.getAccessToken();

    const response = await fetch(`${this.baseUrl}/url-cases/${caseId}`, {
      headers: {
        'Authorization': `Bearer ${token}`,
      },
    });

    if (!response.ok) {
      throw new G2APIError('Failed to fetch URL case', response);
    }

    return response.json();
  }

  /**
   * Fetch case screenshots
   */
  async getCaseScreenshots(caseId: number): Promise<CaseScreenshot[]> {
    const token = await this.authService.getAccessToken();

    const response = await fetch(
      `${this.baseUrl}/case-screenshots?caseId=${caseId}`,
      {
        headers: {
          'Authorization': `Bearer ${token}`,
        },
      }
    );

    if (!response.ok) {
      throw new G2APIError('Failed to fetch screenshots', response);
    }

    return response.json();
  }

  /**
   * Fetch TLD leads
   */
  async getLeadCases(filters?: LeadCaseFilters): Promise<LeadCase[]> {
    const token = await this.authService.getAccessToken();

    const params = new URLSearchParams(
      Object.entries(filters || {}).filter(([, v]) => v != null)
    );

    const response = await fetch(`${this.baseUrl}/lead-cases?${params}`, {
      headers: {
        'Authorization': `Bearer ${token}`,
      },
    });

    if (!response.ok) {
      throw new G2APIError('Failed to fetch lead cases', response);
    }

    return response.json();
  }

  /**
   * Fetch specific TLD lead
   */
  async getLeadCase(leadId: number): Promise<LeadCase> {
    const token = await this.authService.getAccessToken();

    const response = await fetch(`${this.baseUrl}/lead-cases/${leadId}`, {
      headers: {
        'Authorization': `Bearer ${token}`,
      },
    });

    if (!response.ok) {
      throw new G2APIError('Failed to fetch lead case', response);
    }

    return response.json();
  }

  /**
   * Take action on case (PMM or TLD)
   */
  async takeAction(
    caseId: number,
    actionId: number,
    reasonId: number,
    comment?: string
  ): Promise<void> {
    const token = await this.authService.getAccessToken();

    const response = await fetch(`${this.baseUrl}/action-cases/${caseId}`, {
      method: 'PUT',
      headers: {
        'Authorization': `Bearer ${token}`,
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({
        actionId,
        reasonId,
        comment,
      }),
    });

    if (!response.ok) {
      throw new G2APIError('Failed to take action', response);
    }

    // Log action in database
    await this.logAction(caseId, actionId, reasonId, comment);
  }

  /**
   * Request TLD investigation
   */
  async requestInvestigation(
    request: InvestigationRequest
  ): Promise<InvestigationResponse> {
    const token = await this.authService.getAccessToken();

    const response = await fetch(
      `${this.baseUrl}/client-requested-investigation-cases`,
      {
        method: 'POST',
        headers: {
          'Authorization': `Bearer ${token}`,
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(request),
      }
    );

    if (!response.ok) {
      throw new G2APIError('Failed to request investigation', response);
    }

    const result = await response.json();

    // Store investigation request
    await db.insert(tldInvestigations).values({
      investigationId: result.investigationId,
      merchantId: request.merchantId,
      urlId: request.urlId,
      businessId: request.businessId,
      requestedBy: 'system', // Replace with actual user
      requestedDate: new Date(),
      status: 'REQUESTED',
      investigationData: result,
    });

    return result;
  }

  /**
   * Report test transaction decline
   */
  async reportTraceHit(
    traceCaseId: number,
    request: TraceHitRequest
  ): Promise<void> {
    const token = await this.authService.getAccessToken();

    const response = await fetch(
      `${this.baseUrl}/trace-cases/${traceCaseId}/trace-hit`,
      {
        method: 'POST',
        headers: {
          'Authorization': `Bearer ${token}`,
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(request),
      }
    );

    if (!response.ok) {
      throw new G2APIError('Failed to report trace hit', response);
    }

    // Update trace status
    await db.update(tldTraces)
      .set({
        status: 'HIT_REPORTED',
        hitReportedDate: new Date(),
      })
      .where(eq(tldTraces.traceCaseId, traceCaseId));
  }

  /**
   * Sync new PMM cases from G2
   */
  async syncPMMCases(daysBack: number = 7): Promise<number> {
    const publishedAfter = new Date();
    publishedAfter.setDate(publishedAfter.getDate() - daysBack);

    const cases = await this.getURLCases({
      publishedAfter: publishedAfter.toISOString(),
      status: 'PUBLISHED',
    });

    let syncedCount = 0;

    for (const urlCase of cases) {
      // Check if case already exists
      const existing = await db.select()
        .from(pmmCases)
        .where(eq(pmmCases.caseId, urlCase.caseId))
        .limit(1);

      if (existing.length === 0) {
        // Fetch screenshots
        const screenshots = await this.getCaseScreenshots(urlCase.caseId);

        // Insert new case
        await db.insert(pmmCases).values({
          caseId: urlCase.caseId,
          merchantId: urlCase.merchantId,
          urlId: urlCase.urlId,
          businessId: urlCase.businessId,
          merchantName: urlCase.merchantName,
          urlString: urlCase.urlString,
          caseStatus: urlCase.caseStatus,
          caseSeverity: urlCase.caseSeverity,
          caseCategory: urlCase.caseCategory,
          caseSubCategory: urlCase.caseSubCategory,
          publishedDate: new Date(urlCase.publishedDate),
          dueDate: new Date(urlCase.dueDate),
          caseData: urlCase,
        });

        // Store screenshots
        for (const screenshot of screenshots) {
          await db.insert(caseScreenshots).values({
            caseId: urlCase.caseId,
            screenshotUrl: screenshot.screenshotUrl,
            screenshotBase64: screenshot.screenshotBase64,
            caption: screenshot.caption,
            capturedDate: new Date(screenshot.capturedDate),
          });
        }

        syncedCount++;
      }
    }

    return syncedCount;
  }

  /**
   * Sync new TLD leads from G2
   */
  async syncTLDLeads(daysBack: number = 7): Promise<number> {
    const publishedAfter = new Date();
    publishedAfter.setDate(publishedAfter.getDate() - daysBack);

    const leads = await this.getLeadCases({
      publishedAfter: publishedAfter.toISOString(),
      status: 'PUBLISHED',
    });

    let syncedCount = 0;

    for (const lead of leads) {
      const existing = await db.select()
        .from(tldLeads)
        .where(eq(tldLeads.leadId, lead.leadId))
        .limit(1);

      if (existing.length === 0) {
        await db.insert(tldLeads).values({
          leadId: lead.leadId,
          merchantId: lead.merchantId,
          urlId: lead.urlId,
          businessId: lead.businessId,
          merchantName: lead.merchantName,
          urlString: lead.urlString,
          leadStatus: lead.leadStatus,
          riskScore: lead.riskScore,
          publishedDate: new Date(lead.publishedDate),
          leadData: lead,
        });

        syncedCount++;
      }
    }

    return syncedCount;
  }

  private async logAction(
    caseId: number,
    actionId: number,
    reasonId: number,
    comment?: string
  ): Promise<void> {
    // Implementation depends on whether it's PMM or TLD case
    // Log to appropriate audit table
  }
}
