## Polling vs Webhook Strategy

### Webhook Approach (Recommended)
**Pros:**
- Real-time notifications
- Reduces API calls
- Lower latency
- More efficient

**Cons:**
- Requires public endpoint
- Need to handle delivery failures
- Additional infrastructure

**Polling Cadence (Fallback):**
- **TLD Leads:** Every 5 minutes (real-time alerts needed)
- **PMM Cases:** Every 1 hour (monthly reports)
- **Investigations:** Every 30 minutes

```typescript
// Scheduled polling jobs
export class MonitoringSyncScheduler {
  async pollTLDLeads(): Promise<void> {
    const monitoringService = new G2MonitoringService();

    try {
      const syncedCount = await monitoringService.syncTLDLeads(1); // Last 24 hours

      if (syncedCount > 0) {
        await notifyTeam(`${syncedCount} new TLD leads detected`);
      }
    } catch (error) {
      console.error('TLD lead sync error:', error);
    }
  }

  async pollPMMCases(): Promise<void> {
    const monitoringService = new G2MonitoringService();

    try {
      const syncedCount = await monitoringService.syncPMMCases(7); // Last 7 days

      if (syncedCount > 0) {
        await notifyTeam(`${syncedCount} new PMM cases detected`);
      }
    } catch (error) {
      console.error('PMM case sync error:', error);
    }
  }
}
